import React from 'react';
import Logobw from './Resources/Logobw.png'
import './Styles.css'
const Navbar = () => {
    const handleViewResume = () => {
        window.open(process.env.PUBLIC_URL +'./Resources/Mudit_Sharma_resume.pdf', '_blank');
      };
  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="logo"><img src={Logobw} alt="Your Logo" className="logo" /></div>
        <div className="nav-buttons">
            <button className="nav-button" id='b1' onClick={handleViewResume}>View Resume</button>
          <a href="/contact" className="nav-button"id='b2'>Contact</a>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
